script: |
  super -f text -I q549.spq | sort > q549.out

inputs:
  - name: q549.spq
    data: |
      SELECT CAST ( - col1 AS INTEGER ) * - - col1 - - col0 + - 5 FROM tab0 (FORMAT parquet) WHERE NULL NOT IN ( 45 * - col0, - col2, col2 ) AND NULL IS NOT NULL;
  - name: tab0

outputs:
  - name: q549.out
    data: |
